import React from 'react';
import { useLocation } from 'react-router-dom';

function StudentDashboard() {
    const location = useLocation();
    const userData = location.state ? location.state.user : null;

    return (
        <div>
            <h1>学生信息面板</h1>
            {userData ? (
                <div>
                    <p>姓名: {userData[1]}</p>
                    <p>学位: {userData[2]}</p>
                    <p>宿舍: {userData[4]}</p>
                </div>
            ) : (
                <p>无用户数据</p>
            )}
        </div>
    );
}

export default StudentDashboard;
